#include <cstdlib>
#include <iostream>
#include <list>
#include <map>
#include <queue>
#include <sstream>
#include <string>
#include <unordered_map>
#include <unordered_set>
#include <vector>

using namespace std;

class Solution {
public:
  string removeKdigits(string num, int k) {
    int digits = num.size() - k;
    vector<char> stk = vector<char>(num.length());
    int top = 0;
    // k keeps track of how many characters we can remove
    // if the previous character in stk is larger than the current one
    // then removing it will get a smaller number
    // but we can only do so when k is larger than 0
    for (int i = 0; i < num.size(); ++i) {
      char c = num[i];
      while (top > 0 && stk[top - 1] > c && k > 0) {
        top -= 1;
        k -= 1;
      }
      stk[top++] = c;
    }

    int idx = 0; // find the index of first non-zero digit
    while (idx < digits && stk[idx] == '0') {
      idx++;
    }
    if (idx == digits) {
      return "0";
    } else {
      string ret;
      for (int i = idx; i < digits; i++) {
        ret.push_back(stk[i]);
      }
      return ret;
    }
  }
};

int main(int argc, const char * argv[]) {
  Solution sol;
  string num;
  int k;

  num = "12345678901234567890"; k = 10;
  cout << sol.removeKdigits(num, k) << endl;

  num = "1111111"; k = 3;
  cout << sol.removeKdigits(num, k) << endl;

  num = "112"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "1432219"; k = 3;
  cout << sol.removeKdigits(num, k) << endl;

  num = "10200"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "10"; k = 2;
  cout << sol.removeKdigits(num, k) << endl;

  num = "9"; k = 1;
  cout << sol.removeKdigits(num, k) << endl;

  num = "";
    k = 50000;
    cout << sol.removeKdigits(num, k) << endl;

    num = "";
    k = 100000;
    cout << sol.removeKdigits(num, k) << endl;

  return 0;
}
